## 4. Feature selection for linear model - layer 1 ##
# 4.1 correlation test#
 # We want to use stepwise innitially. #
 # However, our data has a special character #
 # - a lot of missing values exist in data sheet. #
 # Not every research will investigate every #
 # usual features in their own research #
 # Hence, this time we try to use pearson, spearman, and Kedall correlation #
 # methods to select features for the first stage of the algorithm #
    
 # workable code referance: http://f.dataguru.cn/thread-14104-1-1.html #  
 # cor.test(~Variable A + Variable B, Data, method = "spearman", "pearson" or "kendall") #

 # 4.1.1 AGC correletion test #
 cor.test(~AGC+Basal.area..b.a.., inputrawdata.R10.10.fold.3.training.1 ,
          method="pearson")      
 # Original research article published by #
 # Pearson, K., 1901. LIII. On lines and planes of closest fit to systems of points in space. Philosophical Magazine. 2(11), 559-572. #
 # http://pca.narod.ru/pearson1901.pdf #

 cor.test(~AGC+Basal.area..b.a.., inputrawdata.R10.10.fold.3.training.1 ,
          method="spearman")      
 # Original resaerch article published by #
 # Spearman, C., 1904. The Proof and Measurement of Association between Two Things. Am. J. Psychol. 15, 72¡V101. #
 # https://www.jstor.org/stable/pdf/1422689.pdf #

 cor.test(~AGC+Basal.area..b.a.., inputrawdata.R10.10.fold.3.training.1 ,
          method="kendall") 
 # Original resaerch article published by #
 # Kendall, M. G., 1938. A New Measure of Rank Correlation. Biometrika, 30(1-2), 81¡V93. #
 # https://watermark.silverchair.com/30-1-2-81.pdf #

 #... ... next page #
 
