# 4.2. Linear Model for target dependent variables - for layer 1 #
  # If Adj R^2>0.85 or <-0.85 and p-value <0.01 in Pearson's product-moment correlation test,#
  # make a linear model for target variables. #
  # If not, check the Spearman's rank correlation rho and Kendall's rank correlation tau test #
  # If rho>0.85 or <-0.85 and p-value <0.01 in Spearman's test or tau>0.85 or <-0.85 and p-value <0.01, #
  # make a regression model for target variables.#
  # **Make sure the layer 2 values have high precision and accuracy #
  
  # Just for making figures and observing their distribution for fun, #
  #if you find some weird point, just reject them to be a part of layer 2 #
  #AGC#
  qplot(x = AGC,
        y = Basal.area..b.a..,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  #BGC#
  qplot(x = BGC,
        y = Culm.height.3,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  #Has not reach the standard#
  
  #SC#
  qplot(x = SC..soil.carbon.,
        y = Stumps,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  #ANPP#
  qplot(x = ANPP,
        y = CNP,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  #BNPP#
  qplot(x = BNPP,
        y = LNP,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  #TEC#
  #1. TEC=AGC+BGC+SC+Litter#
  #2. #
  qplot(x = TEC..Total.ecosystem.carbon.,
        y = HR,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  #NEP#
  qplot(x = NEP,
        y = mean.annual.temperature4,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  
  # AGC~BA linear model #
  AGC.BA.LR=lm(AGC~Basal.area..b.a.., 
               data = inputrawdata.R10.10.fold.3.training.1,
               na.rm=TRUE) 
  # construce linear model lm(Y~X) #
  summary(AGC.BA.LR) 
  # Statistics summary #

  # BGC~Culm.height.3 linear model #
  BGC.Culm.height.3.LR=lm(BGC~ln(Culm.height.3), 
               data = inputrawdata.R10.10.fold.3.training.1,
               na.rm=TRUE) 
  # construce linear model lm(Y~X) #
  summary(BGC.Culm.height.3.LR) 
  # Statistics summary #
  # This is not reaching the standard, R^2 < 0.85 or >-0.85 #
  
  # SC..soil.carbon.~Stump linear model #
  SC..soil.carbon..Stumps.LR=lm(SC..soil.carbon.~exp(Stumps), 
                          data = inputrawdata.R10.10.fold.3.training.1,
                          na.rm=TRUE) 
  # construce linear model lm(Y~X) #
  summary(SC..soil.carbon..Stumps.LR) 
  # Statistics summary #
  
  # Linear Regression Model diagnosis #
  # It is possible to change dependent and #
  # independent variables depended on your purpose if you like. #  
  # AGB~BA #  
  qplot(x = Basal.area..b.a..,
        y = AGC,
        data = inputrawdata.R10.10.fold.3.training.1, na.rm=TRUE)
  # Observe the distribution #
  
  autoplot(AGC.BA.LR)
  # Draw figues for Model diagnosis #
  
  # Theoretically, after the regression model is fitted, #
  # its residual value must conform to the three assumptions of normality, #
  # independence, and homogeneity of variance, so the next three tests are used. #
  # Check whether these three conditions are met. #
  
  shapiro.test(AGC.BA.LR$residual)
  # normality test #
  # if p-value is high (perhaps over 0.05), it can not reject the null hypothesis #
  # which means the assumption of normal distribution of residual values is reasonable. #
  # If p-value is low, the normal distribution of the residual value is unreasonable #
  
  durbinWatsonTest(AGC.BA.LR)
  # independence test #
  # if p-value is high (perhaps over 0.05), it can not reject the null hypothesis #
  # which means the assumption of the independence of the residual value is reasonable. #
  # If p-value is low, the independence of the residual value is unreasonable #
  
  ncvTest(AGC.BA.LR)
  # homogeneity of variance test #
  # if p-value is high (perhaps over 0.05), it can not reject the null hypothesis #
  # which means the assumption of the homogeneity of variance of the residual value is reasonable. #
  # If p-value is low, the homogeneity of variance of the residual value is unreasonable #

#In the end of layer 1, make linear model and input the high Accuracy & Precision values in data form#
  

